/* navbar content */
.nav-bar{
    display: flex;
    flex-direction: row;
    flex-wrap:wrap;
    max-width: 100%;
    background-color: whitesmoke;
    justify-content: center;
    align-items: center;
    padding:1%;
}
.n-container{
    width:60%;
}
.navbar-item{
    flex-wrap: wrap;
    height: 100px;
    width: 100px;
    border: solid rgb(126, 206, 243);
    background-color: white;
    margin: 0 2%;

}
.text-nav-link{
    font-family: 'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;
    font-size: 2rem;

}
